import React from "react";

// function from data that I get from postman result
function MovieDetail(props) {
  return (
    <div>
      {props.data.map(item => {
        return (
          <div className="row">
            <div className="col-2">
              <img width="100%" src={item.Poster} alt="" />
            </div>
            <div className="col-10">
              <h3>{item.Title}</h3>
              <h4>{item.Year}</h4>
              <p>{item.Synopsis}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default MovieDetail;
